window.onload=function(){iframeDefault();function iframeDefault(){if(!is_gtm_loaded()){const queryString=window.location.search;const urlParams=new URLSearchParams(queryString);const iframeForm=document.getElementById('formIframe');const iframeSrc=iframeForm.src;const iframeNew=iframeSrc.replace('{clickid}',urlParams.get('clickid')).replace('{country}',urlParams.get('country'));iframeForm.src=iframeNew}}
function is_gtm_loaded(){let gtm_started_event=window.dataLayer.find(element=>element['gtm.start']);if(!gtm_started_event){return!1}else if(!gtm_started_event['gtm.uniqueEventId']){return!1}
return!0}}